import Landing from './Pages/Landing'
import { Route, Router, Routes } from 'react-router-dom'

export default function App() {
  return (
    <Router>
      <Routes>
        <Route index path='' element={<Landing />}></Route>
      </Routes>
    </Router>

  )
}
